import React, { useEffect } from "react";
import AOS from 'aos';
import 'aos/dist/aos.css'
import './Styles/Home.css'
function Home()
{
    useEffect(()=>{
        AOS.init({
            duration:2000,
        })
    },[])
    return(
        <div >
            <div id="carouselExampleControls" class="carousel slide" data-bs-ride="carousel">
 
  <p className="text-danger h1 text-center pb-2">Gallery</p>
 <div className="row ">
 <div className="col-sm-4  "><img className="a" data-aos="zoom-in" src="./images/a.jpg"/></div>
  <div className="col-sm-4  "><img className="a" data-aos="zoom-in" src="./images/b.jpg"/></div>
  <div className="col-sm-4  "><img className="a" data-aos="zoom-in" src="./images/c.png"/></div>
 </div>
 <div className="row ">
 <div className="col-sm-4  "><img className="a" data-aos="zoom-in" src="./images/d.png"/></div>
 <div className="col-sm-4  "><img className="a" data-aos="zoom-in" src="./images/e.png"/></div>
 <div className="col-sm-4  "><img className="a" data-aos="zoom-in" src="./images/f.png"/></div>
 </div>
</div>

 


</div>

         
    )
}
export default Home;
